// src/pages/Home.js
import React from 'react';
import Layout from '../components/Layout';

const Home = () => {
  return (
    <Layout>
      <section className="p-6">
        <h1 className="text-3xl font-bold">Welcome to MyApp</h1>
        <p>This is the homepage content.</p>
      </section>
    </Layout>
  );
};

export default Home;
